CREATE TABLE province (
                          province_id SERIAL PRIMARY KEY,
                          province_code VARCHAR(10) NOT NULL,
                          province_eng_name VARCHAR(255) NOT NULL,
                          province_lao_name VARCHAR(255) NOT NULL
);


CREATE TABLE district (
                          district_id SERIAL PRIMARY KEY,
                          district_code VARCHAR(10) NOT NULL,
                          district_eng_name VARCHAR(255) NOT NULL,
                          district_lao_name VARCHAR(255) NOT NULL,
                          province_id INT REFERENCES province(province_id) ON DELETE CASCADE
);

CREATE TABLE village (
                         village_id SERIAL PRIMARY KEY,
                         village_code VARCHAR(10) NOT NULL,
                         village_eng_name VARCHAR(255) NOT NULL,
                         village_lao_name VARCHAR(255) NOT NULL,
                         district_id INT REFERENCES district(district_id) ON DELETE CASCADE
);



